INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56060,'Anak rusa nani','Baru kembang ekor','Apa dosa kami','Lalu tidak tegur', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56061,'Bukan kacang sebarang kacang,','Kacang melilit si kayu jati,','Bukan datang sebarang datang,','Datang membawa hajat di hati.', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56062,'Bukan rapat sebarang rapat','Dari jauh melangkah selari','Silakan ya qadial hajat','Luahan hajat kita dengari', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56063,'Banyak-banyak menanam bunga','Agar tampak cantik di dlam taman','Besar hajat kami tidak terkira','Hendak memetik bunga di taman', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56064,'Hajat bukan sebarang hajat','Hajat ingin menyunting si puteri','Jika tepat kata sepakat','Cincin tanda sarungkanlah ke jari', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56065,'Kami datang menaiki kereta,','Walau jauh tidak terasa,','Hajat ingin memetik bunga,','Kerana kumbang mengada-ngada.', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56066,'Tidur malam tidak lena,','Fikiran melayang serba tak kena,','Senyum lebar hingga ketelinga,','Hati tak keruan teringatkan bunga.', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56067,'Wahai orang di sana,','Orang di sini ingin bertanya,','Sudikah kamu menjadi teman setia,','Jalani kehidupan dunia bersama.', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56068,'Jika kamu katakan ya,','Maka jangan disiakan masa,','Mari kita mulakan upacara,','Sarungkan cincin pada si dia.', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56069,'Memanjat pokok didepan rumah,','Pokok tembikai dibelakang kedai,','Hajat hati nak bina rumah,','Rumah untuk gadis idaman didepan kedai.', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56070,'Bila kacang melilit jati,','Ambilkan parang pembelah pinang,','Bila ada hajat di hati,','Mana tepak tanda meminang.', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56071,'Sirih pinang kacip sudah diberi','Semoga pandai memakan sireh','Hantaran dan penganan telah diberi','Semoga kekal membina sirah', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56072,'Nama sentiasa di dalam hati','Hati di sini di paut orang','Lama-lama di dalam hati','Takut nanti di paut orang', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56073,'Kelapa tua dibelah belah','Masak gulai kupang & lokah','Duduk salah baring pun salah','Rupanya kumbang gatal nak bernikah', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56074,'Bersyair merdu seorang biduan','Biduan kelana dari Parsi','Ingin ditanya gerangan tuan','Dalam hati sudahkah terisi', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56075,'Kelapa parut dibuat kerisik','Kerisik ditimbang berkati-kati','Hajat menggunung ingin merisik','Merisik si gadis pujaan hati', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56076,'Berbudi tinggi Melayu Rawa','Pemuda pemudi jadi harapan','Sirih junjung telah kubawa','Menunggu adinda beri jawapan', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56077,'Anak kecil nangis kesakitan','Ibu terdengar terus meluru','Sidara yang satu kami maksudkan','Hendak membina masjid yang baru', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56078,'Kain songket dibuat baju','Songket dibeli dari pekan','Kedua keluarga sudah setuju','Cepat2lah mereka disatukan', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56079,'Songket dibeli dari Pekan','Hendak dibuat baju kebaya','Sebelum mereka hendak disatukan','Tanyalah dulu orang tuanya?', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56080,'Ambil bakul diatas almari','Bawa kesini diisi bunga','Sebelum mereka menjadi suami & isteri','Pastikan dulu mereka sudah ditemuduga', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56081,'Masuk hutan mencari rotan','Rotan diolah menjadi perabut','Sekejabkami hendak tanya yg punya badan','Apakah setuju apa yg dimaksud', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56082,'Kain pelikat cantik dipakai','Hadiah dari sibuah hati','Semoga bahagia membina mahligai','Pinangan diterima dengan senang hati', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56083,'Maksud hati pergi berenang','Pergi berenang ke air tenang','Maksud hati ingin meminang','Apalah daya belum punya wang', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56084,'Pergi berenang ke air tenang','Tersenggol sayap si ikan patin','Tahankan keinginan untuk meminang','Persiapkan diri lahir dan batin', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56085,'Berjalan jalan mencari makan','Makan di beli di warong madan','Usha kuat siang dan malam','Rezeki datang tak perasan.', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56086,'Terbang bayan menyisih palas,','Pinggir paya subur berangan;','Untung tuan kasih berbalas,','Kasihnya saya masih awangan.', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56087,'Pinggir paya subur berangan,','Hinggap kenari memayung perdu;','Kasihnya saya masih awangan,','Saban hari berteman sendu.', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56088,'Bukan kacip sembarang pilih','Kacip di pilih pembelah pinang','Di dalam hati sudah terpilih','Apa daya duluan di rebut orang', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56089,'Kacip lama jadi pilihan','Pilihan terbaik nak belah pinang','Ajal maut ditangan tuhan','Dah memang bukan jodoh korang', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56090,'Ajal maut memang di tangan tuhan','Mesti pasrah takdir ilahi','Kalau bukan jodoh korang','Jangan simpan di dalam hati', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56091,'Buah berangan di rumpun pinang','Limau kasturi berdaun muda','Niat di hati ingin meminang','Adakah tuan hamba sudah berpunya?', 4, 4);
INSERT INTO pantun (id, bayang1, bayang2, maksud1, maksud2, jenis, sumber) VALUES (56092,'Buah kedondong buah kepayang','Ditanam bersama buah berangan','Di hati tiada orang tersayang','Kalau berkenan hantarlah rombongan.', 4, 4);